ISLAMABAD, Oct 7 (APP):Former member Balochistan Assembly and Provincial Minister Sardar Sarfraz Domki called on the Caretaker Prime Minister Anwaar-ul-Haq Kakar here on Saturday.
During the meeting, they discussed matters relating to Balochistan province and other affairs of mutual interests, a statement issued by the Prime Minister Office said.
